text377406.addInnerText('<div id=\"text377406\" aria-live=\"polite\" ><a id=\"text377406anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377406Font1\" style=\"position:relative;top:-1px;\" >This Act modernises and strengthens a range of espionage offences and introduces a number of new foreign interference laws. The Act provides Australian law enforcement and security agencies with the necessary powers to investigate and the option to pursue prosecution. \n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377406Font1\" style=\"position:relative;top:-1px;\" >Criminal charges and imprisonment are now possible consequences for actions that would previously have been considered security\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377406Font1\" style=\"position:relative;top:-1px;\" >incidents or breaches of administrative policy - this includes the leaking of harmful information to others. &nbsp;\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377406Font1\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text377406Font1\" style=\"position:relative;top:-1px;\" >&nbsp;\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
